import './Navigation.css';

const Navigation = () => {
    return (
        <nav>
            <img className='pic' src="https://w7.pngwing.com/pngs/616/711/png-transparent-inkscape-computer-software-others-logo-black-silhouette.png" alt="" />
            <li><a href="">Profile</a> </li>
            <li><a href="">Dialogues</a> </li>
            <li><a href="">Dating</a> </li>
            <li><a href="">Settings</a> </li>
            <li><a href="">..</a> </li>
        </nav>
    );
   
}

export default Navigation;
